import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate, Link } from 'react-router-dom';
import Navigation from './Navigation';
import './Dashboard.css';
import ImageSlider from './ImageSlider';

const Dashboard = ({ handleLogout }) => {
    const [user, setUser] = useState(null);
    const navigate = useNavigate();

    useEffect(() => {
        const fetchData = async () => {
            try {
                const token = localStorage.getItem('token');
                if (token) {
                    const res = await axios.get('http://localhost:5000/api/auth/dashboard', {
                        headers: { 'Authorization': `Bearer ${token}` }
                    });
                    setUser(res.data.user);
                }
            } catch (err) {
                console.error(err);
            }
        };
        fetchData();
    }, []);

    return (
        <div className="dashboard-container">
            <Navigation handleLogout={handleLogout} />
            <ImageSlider />
            <div className="content">
                {user ? <p>Welcome, {user.name}!</p> : <p>Loading...</p>}
                <h4 className="welcome-text">The ultimate platform for seamless transactions! Whether you're looking to sell your Projects or discover amazing Projects</h4>
            </div>
            <div className="buttons-container">
                <Link to="/browse-products" className="button">
                    Browse Products
                </Link>
                <Link to="/sell" className="button">
                    Become a Seller
                </Link>
            </div>
            <div className="extra-containers">
                <div className="extra-container">
                    <h1>Javascript</h1>
                    <p>Browse Projects Based on Javascript </p>
                    <img src="/assets/image2.jpg" alt="Innovative Solutions" />
                </div>
                <div className="extra-container">
                    <h1>Python</h1>
                    <p>1000+ Python Projects </p>
                    <img src="/assets/image1.jpg" alt="Global Community" />
                </div>
                <div className="extra-container">
                    <h1>Android</h1>
                    <p>100+ Android Projects</p>
                    <img src="/assets/image3.jpg" alt="Exclusive Offers" />
                </div>
                <div className="extra-container">
                    <h1>Java</h1>
                    <p>500+ Java P</p>
                    <img src="/path/to/image4.jpg" alt="Expert Support" />
                </div>
                <div className="extra-container">
                    <h1>Seamless Integration</h1>
                    <p>Our platform integrates seamlessly with your existing tools and workflows, making it easier than ever to get started and stay productive.</p>
                    <img src="/path/to/image5.jpg" alt="Seamless Integration" />
                </div>
                <div className="extra-container">
                    <h1>Continuous Improvement</h1>
                    <p>We are committed to continuous improvement, constantly evolving our platform to provide you with the best experience possible.</p>
                    <img src="/path/to/image6.jpg" alt="Continuous Improvement" />
                </div>
            </div>
        </div>
    );
};

export default Dashboard;
